import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for products to trigger filter visibility
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for results and filter to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Apply price range filter
    await page.fill('#minPrice', '100');
    await page.fill('#maxPrice', '500');
    await page.click('.apply-filter');

    // Wait for filtered results
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract filtered product data
    const productData = await page.$$eval('.product-card', products => 
      products.map(product => {
        const priceText = product.querySelector('.product-price').textContent;
        const priceMatch = priceText.match(/\$(\d+\.\d{2})/);
        return {
          title: product.querySelector('.product-title').textContent.trim(),
          price: priceMatch ? parseFloat(priceMatch[1]) : 0
        };
      })
    );

    return {
      success: true,
      action: "Applied price range filter ($100 - $500) to electronics search results",
      extractedData: {
        filteredProducts: productData,
        productCount: productData.length,
        priceRange: { min: 100, max: 500 }
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
